import React, { Component } from 'react';
import $ from 'jquery';

const apiKey = '15e1bbc41548aa6ea02bac4f092efa6f&language=en-US&page=1'

export default class NowPlaying extends React.Component {
    constructor(props) {
      super(props);

      this.state = {person: []};
    }

    componentDidMount() {
      this.NowPlaying();
    }

    NowPlaying() {
      $.getJSON('https://api.themoviedb.org/3/movie/now_playing?api_key=15e1bbc41548aa6ea02bac4f092efa6f&language=en-US&page=1')
        .then(({ results }) => this.setState({ person: results }));
    }

    render() {
      const persons = this.state.person

      return (
        <div id="layout-content" className="layout-content-wrapper">
          <div className="panel-list">{ persons }</div>
        </div>
      );
    }
  }








